    <meta name="viewport"

    <title>GSAP</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Open+Sans:wght@400;500;700&family=Poppins:wght@300;400;500&family=Roboto:wght@400;500;700&display=swap');

    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            scroll-behavior: smooth;
        }

        .background {
            display: block;
            /*width: 100%;*/
            /*height: 100vh;*/
            position: fixed;
            top: 0;
            left: 0;
            z-index: -1;
        }

        .scrollElement {
            position: absolute;
            height: 8000px;
            width: 100px;
            top: 0;
            z-index: 0;
        }

        .navbar .max-width {
            position: absolute;
            width: 100%;
            height: 2rem;
            display: flex;
            justify-content: space-around;
            align-items: center;
            color: #fff;
        }

        .navs {
            display: inline-block;
            padding: 0 1rem;
        }

        .h_main_heading {
            font-size: 4rem;
            font-weight: 900;
            color: white;
        }

        .home .max-width {
            height: 100vh;
            display: flex;
        }

        .homeContent {
            margin: auto 4rem;
            font-family: 'Poppins', sans-serif;
        }

        .h_buttons {
            padding: 1rem 1.5rem;
            display: inline-block;
            border-radius: 2rem;
            background: white;
            color: black;
            font-size: 1rem;

        }

    </style>
</head>
